import React from 'react'

export const Header = () => {
    return (
        <div
            style={{
                display: "flex",
                justifyContent: "space-around",
                border:"2px solid red"
            }}>
            <div><p>Home</p></div>
            <div><p>Cart</p></div>
        </div>
    )
}
